import React, { Component } from 'react';
import '../components/wrapper/mainSite';
import WebsiteLayout from '../components/wrapper/mainSite';
const ImageList = [
	require('./images/homepage/image1.png'),
	require('images/homepage/image2.png'),
	require('images/homepage/image3.png'),
	require('images/homepage/image4.png'),
	require('images/homepage/image5.png'),
	require('images/homepage/image6.png')
];
export default class App extends Component {
	render() {
		return (
			<WebsiteLayout>
				<div>App</div>
			</WebsiteLayout>
		);
	}
}
